CREATE TABLE IF NOT EXISTS data (
mal_id INT NULL,
title VARCHAR(43) NULL,
video_url VARCHAR(85) NULL,
url VARCHAR(79) NULL,
image_url VARCHAR(91) NULL,
type VARCHAR(5) NULL,
watching_status INT NULL,
score INT NULL,
watched_episodes INT NULL,
total_episodes INT NULL,
airing_status INT NULL,
rating VARCHAR(5) NULL,
start_date VARCHAR(25) NULL,
end_date VARCHAR(25) NULL,
priority VARCHAR(3) NULL
);

